import React from 'react';

const SaveComponentForm = () => {

  const handleSave = (e) => {
    e.preventDefault();
    console.log(e.target[0].value);
  };

  return (
    <form onSubmit={handleSave}>
      <label>Component Name: </label>
      <input type="text" />
      <br />
      <button type="submit">Save</button>
    </form>
  );
};

export default SaveComponentForm;
